import iconinterro from './image/iconinterro.png'


function Modalconfirm() {

    const stylecontainer = {
        position:'absolute',
        top:'0',
        bottom:'0',
        right:'0',
        left:'0'
    }

    const stylediv = {
        width:'500px',
        borderRadius: '10px',
        boxShadow: '0px 3px 3px 1px rgba(128, 128, 128, 0.75)',
        padding:'40px'
    }


    const imgStyle = {
        width: '100%', 
        height: 'auto' 
      };

 


    return (
       <div className='d-flex justify-content-center align-items-center' style={stylecontainer}>
            <div style={stylediv} className="d-flex flex-row justify-content-center align-items-center">
                <div>
                    <img src='' alt="icon d'intérrogation"/>
                </div>
                <div className='d-flex flex-column justify-content-center align-items-center'>
                    <div className='d-flex flex-row justify-content-center align-items-center'>Voulez-vous vraiment supprimer l'élément</div>
                    <div className='d-flex flex-row justify-content-center align-items-center'>
                        <div><button type='button'>Oui</button></div>
                        <div><button type='button'>Non</button></div>
                        
                    </div>
                </div>
            </div>
       </div>
    )

}

export default Modalconfirm;
